import React from 'react'
import ProjectSummary from './ProjectSummary'

const ProjectList = () => {
  return (
    <ul className="project-list section collapsible">  
      <ProjectSummary />
      <ProjectSummary />
      <ProjectSummary />
      <ProjectSummary />
    </ul>
  )
}

export default ProjectList;
